/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER notification_log_bu

BEFORE UPDATE ON notification_log

FOR EACH ROW

BEGIN

  DECLARE ts DATETIME;

  DECLARE ts_tz DATETIME;

  SET ts := COALESCE(NEW.created_at, CURRENT_TIMESTAMP);

  SET ts_tz := CONVERT_TZ(ts, '+00:00', '+08:00');



  IF ts_tz IS NULL THEN

    SET NEW.bucket_date := DATE(ts);

  ELSE

    SET NEW.bucket_date := DATE(ts_tz);

  END IF;

END */;;
